import { useNavigate } from "react-router-dom";
import { useState, useRef, useEffect } from "react";
import styles from "./Patient_Dashboard.module.css";
import { GENERATE_SESSION_URL } from "../api/constants";
import axios from "axios";

const Generate_Session = () => {
  const navigate = useNavigate();
  const name = localStorage.getItem("name");
  const userId = localStorage.getItem("userId");
  const token = localStorage.getItem("accessToken");
  const [examId, setExamId] = useState("");
  const [errMsg, setErrMsg] = useState("");
  const errRef = useRef();

  useEffect(() => {
    post();
  }, []);

  const post = async () => {
    axios
      .post(GENERATE_SESSION_URL, {
        token: token,
        userId: userId,
      })
      .then(function (response) {
        console.log("success");
        setExamId(response?.data?.examId);
      })
      .catch(function (err) {
        console.log(err);
        setExamId("1234");
        if (!err?.response) {
          setErrMsg("No Server Response");
        } else if (err.response?.status === 400) {
          setErrMsg("There was an error, please try again.");
        } else if (err.response?.status === 403) {
          setErrMsg("Action Forbidden");
        } else {
          setErrMsg("Server encountered an error, please try again.");
        }
      });
  };

  const Allow = async () => {
    navigate("/allowsession");
  };
  const Back = async () => {
    navigate("/patient");
  };

  return (
    <>
      {success ? (
        <section>
          <h1>You are logged in!</h1>
          <br />
          <p>
            <a href="#">Go to Home</a>
          </p>
        </section>
      ) : (
        <section>
          <p
            ref={errRef}
            className={errMsg ? "errmsg" : "offscreen"}
            aria-live="assertive"
          >
            {errMsg}
          </p>
          <h1>Sign In</h1>
          <form onSubmit={handleSubmit}>
            <label htmlFor="username">Username:</label>
            <input
              type="text"
              id="username"
              ref={userRef}
              autoComplete="off"
              onChange={(e) => setUser(e.target.value)}
              value={user}
              required
            />

            <label htmlFor="password">Password:</label>
            <input
              type="password"
              id="password"
              onChange={(e) => setPwd(e.target.value)}
              value={pwd}
              required
            />
            <button>Sign In</button>
          </form>
          <p>
            Need an Account?
            <br />
            <span className="line">
              {/*put router link here*/}
              <a href="#">Sign Up</a>
            </span>
          </p>
        </section>
      )}
    </>
    // <div className={styles.container}>
    //   <h2 className={styles.header}>Generating a Session for {name}</h2>
    //   <div className={styles.buttons_container}>
    //     <p
    //       ref={errRef}
